 var AppObj := ?
 var DialogLoc := rootfolder.internal.dialog
 var DialogClass : object := str_to_obj(to_str( DialogLoc, ".", AppObj.objType))
 
 var AltKeyPressed : boolean := getAsyncKeyState( 17 ) < 0 // Check if Alt key is pressed
 if AltKeyPressed 
 	AppObj.openDialog
 else
 	
 	if AppObj.OpenedDialog = void 
 		var newFolder : object := DialogLoc.createFolder
 		
 		var newDialog : object := DialogClass.derive(DialogLoc)
 		newDialog.moveToFolder( newFolder )
 		newDialog.name := AppObj.name
 		
 		AppObj.OpenedDialog := newDialog
 		
 		newDialog.openedBy := AppObj
 		newDialog.Label := "Cross-sliding car"
 		
 		newDialog.dialogInit
 		
 		newDialog.open
 	else
 		AppObj.openedDialog.open
 			
 	end
 end
